import React, { Component } from 'react';
import {
    PopupboxManager,
    PopupboxContainer
} from 'react-popupbox';

export default class Test extends Component{

    openSignInPopupbox() {

        const contentSign = (
            <div>
                <div className="apply-vacancy-title-text">
                    <p className="apply-vacancy-title-popup">
                        <span className="color-text-main-signin">Працюй із задоволенням</span>
                        <span className="color-text-signin">та отримуй гідну зарплатню</span>
                    </p>
                </div>
            </div>
        )
        PopupboxManager.open({
            contentSign,
            config: {
                titleBar: {
                    enable: true,
                },
                fadeIn: true,
                fadeInSpeed: 500
            }

        })
    }

    render(){
        return (
            <div>
                <button onClick={openSignInPopupbox}>Click me</button>
                <PopupboxContainer />
            </div>
        )
    }


}
